        {
            strSerialNo = purchaseRepository.GetPaymentVoucherNo(CompanyId, FinancialYearId, decPaymenVoucherId);
            payment.VoucherNo = strPrefix + strSerialNo + strSuffix;
        }
        else
        {
            payment.VoucherNo = string.Empty;
        }
        //LoadPurchaseInvoice
        if (mster.LedgerId > 0)
        {
            articleModel = purchaseRepository.GetSupplierPaymentList(mster.LedgerId);
            foreach (var item in articleModel)
            {
                decTotalDue = decTotalDue + item.TotalDue;
                decTotal = decTotal + item.GrandTotal;
            }
        }
        else
        {
            articleModel.Clear();
            mster.CashAmount = 0;
            mster.BankAmount = 0;
            mster.CreditAmount = 0;
        }
        StateHasChanged();
        payment.TotalAmount = Math.Round(decTotal, PublicVariables._inNoOfDecimalPlaces);
        payment.CashAmount = 0;
        payment.BankAmount = 0;
        payment.CreditAmount = 0;
        showPay = true;
    }
