                        paraSc.Add("@DetailsId", mster.PurchaseReturnMasterId);
                        paraSc.Add("@YearId", FinancialYearId);
                        paraSc.Add("@InvoiceNo", string.Empty);
                        paraSc.Add("@VoucherTypeId", decPaymenVoucherId);
                        paraSc.Add("@CompanyId", CompanyId);
