                        paraCash.Add("@AddedDate", DateTime.Now);
                        var valueCash = sqlcon.Query<long>("LedgerPostingInsert", paraCash, sql, true, 0, commandType: CommandType.StoredProcedure);
                    }
                    sql.Commit();
