                strDate = DreamerDateConveter.convertToAD(strNepaliDate).ToShortDateString();
                payment.Date = Convert.ToDateTime(strDate);

            }
            else
            {
                strDate = DreamerDateConveter.convertToAD(strNepaliDate).ToShortDateString();
                payment.Date = Convert.ToDateTime(strDate);

